column3:
Jaga kesehatan ibu hamil dengan Prenagen Liquid Juice merupakan minuman sari buah asli berasal dari perpaduan buah Pomegranate (delima merah) dan Grape (Anggur). Buah Delima dipercaya sebagai lambang kemakmuran dan kesuburan yang sudah melegenda. Minum Prenagen Juice kapan saja dan di mana saja sebagai selingan sehat untuk melengkapi kebutuhan nutrisi Ibu hamil untuk mempersiapkan kehamilan maupun sedang hamil juga menyusui.



Spesifikasi:

Rasa Pomegranate dan Grape;
Isi 300ml;
Kemasan botol
Jus.


Keunggulan:

Perpaduan buah Pomegranate dan Grape;
Tinggi Vitamin C;
Bebas lemak;
Dapat langsung diminum.


Kegunaan:

Untuk pembentukan sel darah merah sehingga dapat membantu mengurangi risiko anemia sehingga kesehatan ibu hamil tetap terjaga dan menghindari resiko cacat tabung saraf pada janin (NTD);
Untuk pembentukan & pemeliharaan jaringan kolagen sehingga kulit lebih kencang;
Tidak menyebabkan kenaikan berat badan berlebih.



Anjuran: 2 botol/hari.


Perhatian untuk pemakaian kemasan :
Simpan di lemari pendingin, kocok dulu sebelum diminum dan segera habiskan setelah dibuka.
